help_controls_move_up:"Nach oben",help_controls_rotate:"Kamera drehen",help_controls_zoom:"Vergr\u00f6\u00dfern / Verkleinern",help_detailed_instructions:"Detaillierte Anweisungen",help_p1:"Ihnen wird eine Geometrie von Gesichtern pr\u00e4sentiert. Einige Gesichter enthalten Minen (Bomben), andere nicht. Wenn Sie auf ein Gesicht klicken, das eine Bombe enth\u00e4lt, verlieren Sie. Wenn Sie alle Gesichter anklicken (ohne.) Klicken Sie auf eine Bombe), die Sie gewinnen. ",help_p2:"Wenn Sie auf ein Gesicht klicken, das keine Bombe hat, wird die Anzahl der benachbarten Gesichter angezeigt, die Bomben enthalten. Verwenden Sie diese Informationen sowie einige Vermutungsarbeiten, um die Bomben zu vermeiden. Die Nachbarn des Gesichtes k\u00f6nnen die Gesichter sein, die eine Kante oder einen Scheitelpunkt teilen. ",
help_p3:"Um ein Gesicht zu \u00f6ffnen, klicken Sie mit der linken Maustaste darauf und klicken Sie mit der linken Maustaste darauf. Um ein Gesicht zu markieren, das Sie f\u00fcr eine Bombe halten, klicken Sie mit der rechten Maustaste, um eine Flagge zu platzieren. Die markierten Gesichter k\u00f6nnen nicht ge\u00f6ffnet werden. Klicken Sie mit der rechten Maustaste auf ein markiertes Gesicht Platzieren Sie ein Fragezeichen (dieses Gesicht kann angeklickt werden.) Entfernen Sie das Fragezeichen, indem Sie erneut auf das Gesicht klicken. ",
help_p4:'Ein Gesicht "Nachbarn" sind die Fl\u00e4chen, die \u00fcber, unter, links, rechts und alle 4 Diagonalen liegen, oder Fl\u00e4chen, die einen Scheitelpunkt mit der Fl\u00e4che teilen in einer Ecke haben weniger Nachbarn. ',help_p5:"Wenn Sie ein Gesicht mit 0 benachbarten Bomben \u00f6ffnen, werden alle Nachbarn automatisch ge\u00f6ffnet. Dies kann dazu f\u00fchren, dass sich ein gro\u00dfer Bereich automatisch \u00f6ffnet.",help_p6:"Um einen Bombenmarker von einem Gesicht zu entfernen, zeigen Sie darauf und klicken Sie erneut mit der rechten Maustaste. Die markierten Gesichter k\u00f6nnen nicht ge\u00f6ffnet werden.",
help_p7:"Wenn Sie eine Bombe falsch markieren, m\u00fcssen Sie den Fehler korrigieren, bevor Sie gewinnen k\u00f6nnen. Falsche Bombenmarkierung bringt Sie nicht um, aber es kann zu Fehlern f\u00fchren, die dies tun.",help_p8:"Sie m\u00fcssen nicht alle Bomben markieren, um zu gewinnen; Sie m\u00fcssen nur alle nicht-Bombengesichter \u00f6ffnen.",help_p9:"Wenn Sie zweimal mit der rechten Maustaste klicken, erhalten Sie ein Fragezeichen-Symbol. Dies kann n\u00fctzlich sein, wenn Sie sich nicht sicher sind, ob Sie ein Quadrat haben. Klicken Sie erneut mit der rechten Maustaste, um das Fragezeichen zu entfernen.",
